Storyline:

Krishan Murthy (Rajendra Prasad) is a rich dad only son. His father Satyanarayana (Nutan Prasad) wants his son to get married to a girl whom he choose because of his bitter experience with love marriage. Before selecting the bride Satyanaryana has a big list of conditions which needs to be fulfilled before he finalizes the bridge for his son. Like every movie this too has a twist ie son fall in love with Padma (Rajini) and want to get married only to her. After lot of tussle both father &amp; son enter into an understanding that if Krishna Murthy conveniences Padma's father Lakshimpathy (Kota Srinivas Rao) without using his father name by 31st December than Satyanarayana will allow his to get married to Padma. Else he has to obey his father and marry the girl whom he chooses. First half of the movie revolves around father son &amp; girl. Only in the second half we get to meet the most important character in the movie Lakshmipathy &amp; Ara Gundu(Brahmanandam)... 



